$(document).ready(function(){$(".on-default").click(function(t){t.preventDefault(),$.ajax({url:window.baseUrl+"/admin/multivendor/"+$(this).data("title")+"/"+$(this).data("id"),type:"PUT",headers:{"X-CSRF-TOKEN":$("#csrf-token").attr("content")},success:function(){location.reload()},error:function(t){new PNotify({title:"Error",text:t.responseJSON.message,type:"error",addclass:"notification-error",icon:"fas fa-times"})}})})});